const CreateTodo = ({ createTodoClickHandler }) => {
   const [title, setTitle] = useState("aaa");
   const changeHandler = (value) => {
      setTitle(value);
   };
   useEffect(() => {
      console.log(title);
   }, [title]);
   return (
      <div>
         <input type="text" onChange={(event) => changeHandler(event.target.value)} value={title} />

         <button>add</button>
      </div>
   );
};

export default CreateTodo;
